import React from "react";
import Mobilephones from "./Mobilephones";
import { Link } from "react-router-dom";

const Mobilephone = (props) => {
  return (
    <>
      {props.mobilephones.map((mobile, id) => (
        <Link to={`/blogs/${mobile.id}`} className="links">
          <Mobilephones key={id} mobile={mobile} />
        </Link>
      ))}
    </>
  );
};

export default Mobilephone;
